const AppContainerStyle = {
  margin: 20,
  padding: 20,
  maxWidth: 700,
  display: 'flex',
  flex: 1,
  justifyContent: 'center'
};

const AppContainer = props => (
  <div style={AppContainerStyle}>
    {props.children}
  </div>
);

export default AppContainer;
